- input: "TEXT\x1CC00131185\x1C34020594\x1C\x1CF3XA\x1CThis memo is in reference to
    FEC Letter dated February 19, 2010.  Item 1: Disclosing the full name, mailing
    address, occupation and name of employer.  AOPA PAC has updated the full name,
    mailing address, occupation and/or name of employer for several individuals who
    have given in excess of $200 on this revised Year End Report.  For the individuals
    whose information is still incomplete, AOPA PAC have sent out letters requesting
    this information.  Once this information is obtained from the individuals, AOPA
    PAC will provide this information to the FEC in a timely manner.  On AOPA PAC's
    original solicitation, it includes clear and conspicuous request from the individual
    to provide the required information to AOPA PAC in order to satisfy federal law.
    \ If this information is not provided, AOPA PAC does in fact demonstrate Best
    Efforts when obtaining missing information by sending out a hard copy letter to
    the individual in the same week that the receipt is received with a pre-addressed
    return envelope.  The letter clearly asks for the missing information and that
    it is required by federal law to be provided.  If AOPA PAC does receive any missing
    information, our database is updated and then either an amended report will be
    filed before our next scheduled report or a memo Schedule A will be filed with
    the next scheduled report.  Item 2: The Excessive contributions for Guthrie for
    Congress and Friends for Harry Reid were re-designated on the March 20th Monthly
    2010 Report.  The Guthrie for Congress contributions on 11/18/09 $1,000 and 12/3/09
    $1,000 were re-designated to General 2010.  This was already correct on Guthrie's
    FEC Report.  The Friends for Harry Reid contribution on 4/26/07 $5,000 was re-designated
    to Primary 2010 and the 12/3/09 $2,000 was re-designated to General 2010.  This
    was already correct on Reid's FEC Report. In addition to the FEC Letter, I made
    a change to Schedule D for Aircraft Owners & Pilots Association related to the
    amount incurred for the period.  The amount changed due to Aircraft Owners & Pilots
    Association decided not to charge administrative expenses to it's connected organization.
